import React from 'react';
import ".button.c"

const Button = ({ className, children, disabled, onclick }) => {
    <button 
      onclick={ onclick }
      className={ `button-text ${ className }` }
      disabled={ disabled }
    >
        { children }

    </button>
}

export default Button;
